function convertFromNormalizedParameterValue(index, value) {
    value = (value < 0 ? 0 : (value > 1 ? 1 : value));

    switch (index) {
    case 2:
    case 3:
        {
            {
                return 0 + value * (1 - 0);
            }
        }
    case 1:
        {
            {
                return 2 + value * (100 - 2);
            }
        }
    case 4:
        {
            {
                return 10 + value * (250 - 10);
            }
        }
    case 0:
        {
            {
                return -30 + value * (18 - -30);
